local mt = {}
local t_DB = {
["ID"] = 1,["SoundType"] = 2,["SoundPath"] = 3,["IOSsound_iosPath"] = 4,["AndroidSoundPath"] = 5,["SoundLoop"] = 6,["SoundVolume"] = 7,["SoundPreload"] = 8,["FadeIn"] = 9,["FadeOut"] = 10,["PlayInterval"] = 11,
}
mt.__index =    function (table, key)
                return table[t_DB[key]]
            end

function getDataById(key_id)
    local id_data = MusicConfig[key_id]

    if id_data == nil then
        return nil
    end
    if getmetatable(id_data) ~= nil then
        return id_data
    end
    setmetatable(id_data, mt)
    return id_data
end

function getArrDataByField(fieldName, fieldValue)
    local arrData = {}
    for k, v in pairs(MusicConfig) do
        if getmetatable(v) == nil then
            setmetatable(v, mt)
        end
        if v[fieldName] == fieldValue then
            arrData[#arrData+1] = v
        end
    end

    return arrData
end

function release()
    _G["DB_MusicConfig"] = nil
    package.loaded["DB_MusicConfig"] = nil
    package.loaded["DBSystem/DB_MusicConfig"] = nil
end
